.axis {
    font-size: var(--font-size-normal);
    cursor: default;
}

.axis>:global(.tick)>line {
    stroke-width: 1px;
    stroke: var(--font-color-light);
    stroke-opacity: 0.5;
    shape-rendering: crispEdges;
}

.axis>path {
    stroke-width: 2px;
}

.grid>path {
    stroke: none;
}

.grid>:global(.tick)>line {
    stroke-width: 1px;
    stroke-opacity: 0.5;
}
